import React, { useEffect} from 'react'
import { useSelector } from 'react-redux';
import ProductCard from '../components/ProductCard/ProductCard';
import SortingBlock from '../components/SortingBlock/SortingBlock';


export default function Products() {
  const products = useSelector(state => state.products)
  const { list, status } = products

  console.log(list)
  return (
    <>
      <h1 className='h2'>All products</h1>
      {/* <SortingBlock /> */}
      {/* { status !== 'ready' && <div>Sorry, something went wrong... please try it again</div>} */}
      {list.lenght > 0 && 
        <div className='cards_container'>
          {list?.filter(el => el.show_product)
            .map(el => <ProductCard key={el.id} {...el} />)
          }
        </div> 
      }
    </>
  )
}
